webpackJsonp([0xc2c465f67de],{384:function(a,A){a.exports={data:{site:{siteMetadata:{title:"Callell.se",author:"Olof Sjögren"}},markdownRemark:{id:"/home/ropaolle/Projects/callell.se/src/pages/Google Cloud OnBoard - Stockholm/index.md absPath of file >>> MarkdownRemark",html:'<p>Igår hölls <a href="https://cloudplatformonline.com/2018-OnBoard-Stockholm.html?mkt_tok=eyJpIjoiWXpRMU4yRTNOREZqWWpVeiIsInQiOiJWZ2VUQlk0SWdkMDlhbmJCTUR4UThjQ2h0Qm9kN2RqTU9QMlZTWEhlWmw3MjZFcksyT2NoU0NlOGdSTkEyNTJLcmRubFRyME1NR3FUUWtUeUxrYXh5eFphSGdORHBTOTU2SEZjMVhTXC9mWllTc2R2Q3B0MnFQUFBTTHRROHc2bU8ifQ%3D%3D">Google Cloud OnBoard</a> - Stockholm vilket var ett lyckat och informativt heldagsevent inriktat på deras molntjänster. Under utbildningen gick Google igenom sju olika övningsscenarion vilka deltagarna i efterhand ska få tillgång till via <a href="https://qwiklabs.com/">Qwiklabs.com</a>, en utbildningstjänst Google nyligen tagit över.</p>\n<p>Jag väntar med spänning på övningsuppgifterna eftersom de tillåter oss att köra testuppgifter mot stora datamängder utan debitering, vilket annars kan vara extremt dyrt. Dessutom utlovades $200 GCP-krediter om uppgifterna slutfördes inom en vecka.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/gob-7c32d7983d65248c157df128206b2c96-30631.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 43.24999999999999%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Stockholm City Conference Center"\n        title=""\n        src="/static/gob-7c32d7983d65248c157df128206b2c96-f8fb9.jpg"\n        srcset="/static/gob-7c32d7983d65248c157df128206b2c96-e8976.jpg 148w,\n/static/gob-7c32d7983d65248c157df128206b2c96-63df2.jpg 295w,\n/static/gob-7c32d7983d65248c157df128206b2c96-f8fb9.jpg 590w,\n/static/gob-7c32d7983d65248c157df128206b2c96-85e3d.jpg 885w,\n/static/gob-7c32d7983d65248c157df128206b2c96-d1924.jpg 1180w,\n/static/gob-7c32d7983d65248c157df128206b2c96-30631.jpg 1600w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>Som sagt, ännu inte fått uppgifterna aktiverade i Qwiklabs.com men det ska ske under dagen.</p>\n<blockquote>\n<p>Cloud OnBoard Stockholm is a free full-day instructor-led training event. Through a combination of instructor-led presentations and lab demos, you will learn how to get started with Google Cloud products like Cloud Dataproc, Cloud Dataflow, BigQuery, Tensorflow and ML APIs.\n>\nJoin us for technical training as well as access to tips and tricks, industry best-practices and Q&#x26;A with the Google Cloud Platform team.</p>\n</blockquote>\n<h3>Training Objectives</h3>\n<p>This training will enable you to: Identify the purpose and value of the key Big Data and Machine Learning products in the Google Cloud Platform. Use Cloud SQL and Cloud Dataproc to migrate existing MySQL and Hadoop/Pig/Spark/Hive workloads to Google Cloud Platform. Employ BigQuery and Cloud Datalab to carry out interactive data analysis. Train and use a neural network using TensorFlow. Utilize ML APIs. Choose between different data processing products on the Google Cloud Platform.</p>\n<h2>Qwiklabs</h2>\n<p>Labbarna avklarade. Qwiklabs fungerade bra och labbarna erbjöd möjligheten att testa alla de projekt som visades under onBoard-eventet. Som bonus fick jag göra om labbarna två gånger då det visade sig att statusen inte sparades om jag loggat in via domänen qwicklabs.com, krävdes att jag var inloggad via google.qwiklabs.com.</p>\n<p>Hur som helst, nu är det klart.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/qwiklabs-1eb7e56aff59e3f939d0c7dbfc36dc76-d3da7.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 104.8064085447263%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Qwiklabs"\n        title=""\n        src="/static/qwiklabs-1eb7e56aff59e3f939d0c7dbfc36dc76-fb8a0.png"\n        srcset="/static/qwiklabs-1eb7e56aff59e3f939d0c7dbfc36dc76-1a291.png 148w,\n/static/qwiklabs-1eb7e56aff59e3f939d0c7dbfc36dc76-2bc4a.png 295w,\n/static/qwiklabs-1eb7e56aff59e3f939d0c7dbfc36dc76-fb8a0.png 590w,\n/static/qwiklabs-1eb7e56aff59e3f939d0c7dbfc36dc76-d3da7.png 749w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>',frontmatter:{title:"Google Cloud OnBoard - Stockholm",date:"February 17, 2018"}}},pathContext:{slug:"/Google Cloud OnBoard - Stockholm/",previous:{fields:{slug:"/Wordpress på VM-instans i Google Cloud Platform/"},frontmatter:{title:"Wordpress på VM-instans i Google Cloud Platform"}},next:null}}}});
